import './App.css';
import Header from './components/header/Header';
import HeaderBanner from './components/header/HeaderBaner/HeaderBanner';
import Bascet from './components/main/bascet/bascet';
import Catalog from './components/main/catalog';
import Login from './components/main/LoginForm/forms/login';
import { BrowserRouter as Router, Route } from "react-router-dom";


function App() {

  return (
    <Router>
      <div className="App">
        <Header />
        {/* <HeaderBanner /> */}
        <Catalog />
        {/* <Login /> */}
        <Route path="/basket" component={Bascet} />
      </div>
    </Router>
  );
}

export default App;
